            </div>
          </div>
          <div className="about_carusel">
            <div className='carousel_image'>
              <Carousel>
              <img src={Technopark1} alt="" />
              <img src={Technopark2} alt="" />
              </Carousel>
          </div>
        </div>
      </div>
      <div className='carousel3'>
        <img src={Background} alt="" />
        <Carousel3/>
      </div>
    </div>

  )
}

export default AboutUs
